// import React from "react";
import Footer from "./Footer";
import Navbar from "./Navbar";

function Home() {
  return (
    <div>
      <Navbar />
      <div>
        <h1>This is the home page</h1>
        <p>Welcome to the universe</p>
      </div>
      <Footer />
    </div>
  );
}

export default Home;
